import React from 'react';
import './Settings.css';

const Settings = () => {
  return (
    <div className="settings">
      <h1>Settings</h1>
      <div className="settings-content">
        <p>Application settings interface coming soon...</p>
      </div>
    </div>
  );
};

export default Settings;
